  input: 'TEXT,F3XA,,"This amendment is filed to clarify the following issues:  The
    GlaxoSmighKline PAC excessive contribution for 2004 was transferred out of the
    account as soon as noted as excessive.  PSC H20 PAC contributed 4,750 in 2004.  After
    rechecking our records, it has been established that the double entry on 12/14/04
    for 1000.00 was indeed just that.  This data entry error has been corrected.  We
    have received contributions from PSC H20 PAC within the limits of the law.  Beginning
    cash balance and Calender year to date totals should match the previous report.  This
    discrepancy was a technical error on our part.  Please note the Pinnacle Direct
    ledger has been amended.  Invoices(accruals) were previously omitted on the report.  With
    regard to the Joint State Fundraising transfers, please note that we have also
    included a miscellaneous electronic transmission to better explain our reconcilation
    of these transfers and the memos associated with the transfer.  Itemized disbursement
    descriptions from schedule B ''noted'' have been further clarified. "'
